import React from "react";
import { Link } from "react-router-dom";

const Sidebar = () => {
  return (
    <aside>
      <nav>
        <div>
          <Link to="/">Home</Link>
        </div>
        <div></div>
        <Link to="/uploads">Uploads</Link>
      </nav>
    </aside>
  );
};

export default Sidebar;
